import React, { Component } from "react";

export class NavBar extends Component {
  render() {
    return (
      <div className="navbar bg-primary">
        <h1>
          <i className="fab fa-barcode" />
          NavBar
        </h1>
      </div>
    );
  }
}

export default NavBar;
